// src/components/ViewerManagement.js
import React from 'react';
import '../../CSS/UserManagement.css';


const UserManagement = ({ onAddViewer, onRemoveViewer, onViewViewers, onBack }) => (
  <div className="viewer-management">
    <h2>Manage Users</h2>
    <div className="button-group">
      <button className="btn btn-add" onClick={onAddUser}>Add User</button>
      <button className="btn btn-remove" onClick={onRemoveViewer}>Remove User</button>
      <button className="btn btn-view" onClick={onViewViewers}>View Users</button>
      <button className="btn btn-back" onClick={onBack}>Back to Admin Options</button>
    </div>
  </div>
);

export default UserManagement;
